import React from "react";

let arr = ["one", "two", "three", "four", "five"];
const CheckBox = () => {


    return (
        <div>
            <input type='button' value='delete' />
            <input type='button' value='reset' /><br />
            {arr.map((item, index) => {
                return <><input type='checkbox' /><span>{item}</span><br /><br /></>
            })}
        </div>
    )


}

export default CheckBox
